    updatedUrl = currentUrl
      .replace(window.location.search, '');

    history.pushState({}, null, app.sanitizer.sanitizeUrl(updatedUrl));
  }

  initPageDataByURLParams(widget, params);

  updatePageUI();

  loadPageData();
}

