function isElementOfParent(parent, element) {
  let isParent = parent === element;

  while (!(isParent = parent === element) && (element = element.parentElement));

  return isParent;
}

exports.isElementOfParent = isElementOfParent;

var dataService = require('dataService');
var getMaxRiskImpact = require('RiskUtils').getMaxRiskImpact;
var getInherentRiskRating = require('RiskUtils').getInherentRiskRating;
var getResidualRiskRating = require('RiskUtils').getResidualRiskRating;
var impactToNumber = require('RiskUtils').impactToNumber;
var OccurrenceOptions = require('UIConst').OccurrenceOptions;

function calculateInheritedRiskRating(process, risks) {
  var maxImpact = 0;

  for (var i = 0; i < risks.length; i++) {
    var currentImpact = getMaxRiskImpact(risks[i]);

    maxImpact = impactToNumber(currentImpact) > impactToNumber(maxImpact) ? currentImpact : maxImpact;
  }

  var maxLikelihood = Math.max.apply(null, risks.map(function (risk) { return OccurrenceOptions.indexOf(risk.RiskDriverLikelihood); })) || 0;

  return getInherentRiskRating(OccurrenceOptions[maxLikelihood], maxImpact);
}

function calculateResidualRiskRating(inheritedRiskRating, controlEffectiveness) {
  return getResidualRiskRating(inheritedRiskRating, controlEffectiveness);
}

function createProcessInfoRecords(query) {
  var records = [];

  var processes = dataService.queryRecords({
    model: 'Process',
    filters: {
      ProcessID: { in: [query.parameters.ProcessID] },
    },
  }).getRecords();

  if (processes.length === 0) return [];

  for (var i = 0; i < processes.length; i++) {
    var process = processes[i];
    var record = dataService.createRecord('ProcessInfo');

    record.ProcessID = process.ProcessID;
    record.Complexity = process.Complexity;
    record.DocumentLastUpdated = process.DocumentLastUpdated;
    record.DocumentUrl = process.DocumentUrl;
    record.Frequency = process.Frequency;
    record.GPM = process.GPM;
    record.GPO = process.GPO;
    record.HCProcessId = process.HCProcessId;
    record.O2CMapping = process.O2CMapping;
    record.PDDOwner = process.PDDOwner;
    record.ProcessControlEffectiveness = process.ProcessControlEffectiveness;
    record.ProcessCreationDate = process.ProcessCreationDate;
    record.ProcessDescription = process.ProcessDescription;
    record.ProcessInherentRiskRating = process.ProcessInherentRiskRating;
    record.ProcessName = process.ProcessName;
    record.ProcessResidualRiskRating = process.ProcessResidualRiskRating;
    record.ProcessRollUp = process.ProcessRollUp;
    record.RCOSubTower = process.RCOSubTower;
    record.RCOTower = process.RCOTower;
    record.OperationsLead = process.OperationsLead;
    record.OutstandingGaps = 0;

    records.push(record);
  }

  var risks = dataService.queryRecords({
    model: 'RiskDriver',
    filters: {
      ProcessID: { in: processes.map(function (process) { return process.ProcessID; }) },
    },
  }).getRecords();

  if (risks.length === 0) return records;

  for (i = 0; i < records.length; i++) {
    var record = records[i]; // jshint ignore:line
    var inherentRiskRating = calculateInheritedRiskRating(record, risks.filter(function (risk) { return risk.ProcessID === record.ProcessID; })); // jshint ignore:line
    record.ProcessInherentRiskRating = inherentRiskRating;
    record.ProcessResidualRiskRating = calculateResidualRiskRating(inherentRiskRating, record.ProcessControlEffectiveness);
  }

  var constrols = dataService.queryRecords({
    model: 'Controls',
    filters: {
      RiskID: { in: risks.map(function (risk) { return risk.RiskID; }) },
    },
  }).getRecords();

  if (constrols.length === 0) return records;

  var gaps = dataService.queryRecords({
    model: 'Gaps',
    filters: {
      ControlId: { in: constrols.map(function (control) { return control.ControlID; }) },
    },
  }).getRecords();

  for (i = 0; i < records.length; i++) {
    records[i].OutstandingGaps = gaps.length;
  }

  return records;
}

exports.createProcessInfoRecords = createProcessInfoRecords;

var ScoreOptions = require('UIConst').ScoreOptions;
var ImpactOptions = require('UIConst').ImpactOptions;

var InherentRiskMap = {
};

InherentRiskMap[ScoreOptions.Remote] = {};
InherentRiskMap[ScoreOptions.Low] = {};
InherentRiskMap[ScoreOptions.Medium] = {};
InherentRiskMap[ScoreOptions.High] = {};

InherentRiskMap[ScoreOptions.Remote][ScoreOptions.DeMinimis] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Remote][ScoreOptions.Low] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Remote][ScoreOptions.Medium] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Remote][ScoreOptions.High] = ScoreOptions.Medium;

InherentRiskMap[ScoreOptions.Low][ScoreOptions.DeMinimis] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Low][ScoreOptions.Low] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Low][ScoreOptions.Medium] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Low][ScoreOptions.High] = ScoreOptions.Medium;

InherentRiskMap[ScoreOptions.Medium][ScoreOptions.DeMinimis] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Medium][ScoreOptions.Low] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.Medium][ScoreOptions.Medium] = ScoreOptions.Medium;
InherentRiskMap[ScoreOptions.Medium][ScoreOptions.High] = ScoreOptions.High;

InherentRiskMap[ScoreOptions.High][ScoreOptions.DeMinimis] = ScoreOptions.Low;
InherentRiskMap[ScoreOptions.High][ScoreOptions.Low] = ScoreOptions.Medium;
InherentRiskMap[ScoreOptions.High][ScoreOptions.Medium] = ScoreOptions.High;
InherentRiskMap[ScoreOptions.High][ScoreOptions.High] = ScoreOptions.High;

var ResidualRiskMap = {
};

ResidualRiskMap[ScoreOptions.Low] = {};
ResidualRiskMap[ScoreOptions.Medium] = {};
ResidualRiskMap[ScoreOptions.High] = {};

ResidualRiskMap[ScoreOptions.Low][ScoreOptions.Low] = ScoreOptions.Low;
ResidualRiskMap[ScoreOptions.Low][ScoreOptions.Medium] = ScoreOptions.Low;
ResidualRiskMap[ScoreOptions.Low][ScoreOptions.High] = ScoreOptions.Low;

ResidualRiskMap[ScoreOptions.Medium][ScoreOptions.Low] = ScoreOptions.Medium;
ResidualRiskMap[ScoreOptions.Medium][ScoreOptions.Medium] = ScoreOptions.Medium;
ResidualRiskMap[ScoreOptions.Medium][ScoreOptions.High] = ScoreOptions.Low;

ResidualRiskMap[ScoreOptions.High][ScoreOptions.Low] = ScoreOptions.High;
ResidualRiskMap[ScoreOptions.High][ScoreOptions.Medium] = ScoreOptions.Medium;
ResidualRiskMap[ScoreOptions.High][ScoreOptions.High] = ScoreOptions.Low;

function impactToNumber(impact) {
  return ImpactOptions.indexOf(impact);
}

function getMaxRiskImpact(risk) {
  var maxImpact = Math.max.apply(null, [
    impactToNumber(risk.FinancialImpact), impactToNumber(risk.LegalComplianceImpact),
    impactToNumber(risk.OperationalImpact), impactToNumber(risk.ReputationalImpact),
  ]) || 0;

  return ImpactOptions[maxImpact];
}

function getInherentRiskRating(maxLikelihood, maxImpact) {
  return InherentRiskMap[maxLikelihood || ScoreOptions.Remote][maxImpact || ScoreOptions.DeMinimis];
}

function getResidualRiskRating(inherentRisk, controlEffectiveness) {
  return ResidualRiskMap[inherentRisk || ScoreOptions.Low][controlEffectiveness || ScoreOptions.Low];
}

exports.getMaxRiskImpact = getMaxRiskImpact;
exports.getInherentRiskRating = getInherentRiskRating;
exports.getResidualRiskRating = getResidualRiskRating;
exports.impactToNumber = impactToNumber;

var ScoreOptions = {
  DeMinimis: 'De-Minimis',
  Remote: 'Remote',

  Low: 'Low',
  Medium: 'Medium',
  High: 'High',
};

var ImpactOptions = [
